    <style>.ribbon{
    position: absolute;
    top: 42px;
    width: 200px;
    padding: 1px 0;
    background: #000;
    color: #eee;

    box-shadow: 0 0 10px rgba(0,0,0,0.5);
}

.ribbon.left{
    left: -42px;
    transform: rotate(-45deg);
}

.ribbon.right{
    right: -42px;
    transform: rotate(45deg);
}

.ribbon a,
.ribbon a:visited,
.ribbon a:active,
.ribbon a:hover{
    display: block;
    padding: 1px 0;
    height: 24px;
    line-height: 24px;

    color: inherit;
    text-align: center;
    text-decoration: none;
    font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Helvetica, Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol";
    font-size: 13px;
    font-weight: 500;

    border: 1px solid rgba(255,255,255,0.3);

    text-shadow: 0 0 10px rgba(0,0,0,0.31);
}

.ribbon.black{
    background: #000;
}

.ribbon.red{
    background: #c00;
}

.ribbon.blue{
    background: #09e;
}

.ribbon.green{
    background: #0a0;
}

.ribbon.orange{
    background: #d80;
}

.ribbon.purple{
    background: #c0c;
}

.ribbon.grey{
    background: #888;
}

.ribbon.white{
    background: #eee;
    color: black;
}
.ribbon.white a{
    border: 2px dotted rgba(100,100,100,0.2);
}

    main .demo {
        width: 100vw !important;
        height: 100vh !important;
        position: fixed;
        top: 0;
        left: 0;
        z-index: 1000;
        margin: 0;
    }
}

#canvas {
    display: none;
    z-index: 1;
    position: absolute;
    top: 0;
    left: 0;
    width: 100vw;
    height: 100vh;
}

.ui {
    display: none;
    z-index: 2;
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
}

.cockpit {
    display: flex;
    align-items: center;
    position: absolute;
    left: calc(50vw - 90px);
    padding: 5px;
    background-color: rgba(255, 255, 255, 0.3);
    border-radius: 0 0 5px 5px;
}

.missile-capacity {
    margin-right: 10px;
    padding-top: 3px;
}

.missile-capacity .missile {
    transform: rotate(-90deg) scale(1.2);
    transition: transform 500ms ease-in;
}

.missile-capacity .missile.hidden {
    transform: translateY(-30px) rotate(-90deg);
}

.missile-capacity{
    display: flex;
    font-family: monospace;
    color: #364f7f;
    font-size: 20px;
    margin-left: 4px;
    margin-right: 15px;
}

.ammo-capacity {
    display: flex;
    font-family: monospace;
    color: #364f7f;
    font-size: 20px;
    margin-left: 13px;
    margin-right: 7px;
}

.ammo-capacity > .ammo {
    margin-left: 1px;
    transition: transform 50ms ease-in;
}

.ammo-capacity > .ammo.hidden {
    transform: translateY(-30px);
}

.thrust {
    position: relative;
    width: 10px;
    height: 30px;
    border-radius: 4px;
    background-image: linear-gradient(179.4deg, rgba(12, 20, 69, 1) -16.9%, rgba(71, 30, 84, 1) 119.9%);
}

.thrust-level {
    position: absolute;
    bottom: 0;
    left: -6px;
    width: 21px;
    height: 7px;
    border-radius: 10px;
    background-image: linear-gradient(179.1deg, rgba(247, 238, 238, 1) -1.9%, rgba(247, 202, 201, 1) 44.9%, rgba(145, 168, 208, 1) 96.1%);
    transition: transform 100ms linear;
}

.minimap {
    position: absolute;
    width: 300px;
    height: 70px;
    right: 10px;
    top: 10px;
}

.log {
    position: absolute;
    top: 90px;
    right: 10px;
    text-align: right;
    font-size: 19px;
}

.log > div {
    overflow: hidden;
    max-height: 24px;
    margin-bottom: 2px;
    transition: max-height 300ms;
}

.log > div.hide {
    max-height: 0;
}

.message {
    display: inline-flex;
    flex-direction: row;
    align-items: center;
    background-color: rgba(255, 255, 255, 0.3);
    text-shadow: 0 1px 0 rgb(82, 161, 255);
    border-radius: 5px;
    padding: 0 3px;
}

.message > * {
    margin-left: 2px;
    margin-right: 2px;
}

<body>
<main>
    <section class="welcome">
        
        <h1>
            <i class="logo"></i>
            Bit Planes
            <i class="logo"></i>
        </h1>
        <p>
            <strong>Controls:</strong><br>
        </p>
        <ul>
            <li>Arrows <kbd></kbd><kbd></kbd>  thrust level.</li>
            <li>Arrows <kbd></kbd><kbd></kbd>  elevator controls.</li>
            <li><kbd>Space</kbd>  fire a gun. <kbd>X</kbd>  deploy a missile.</li>
            <li><kbd>C</kbd>  catapult / parachute and get new plane at the barn.</li>
        </ul>

        <form id="game">
            <label>
                <input type="text" name="nickname" placeholder="Nickname">
            </label>
            <div class="game-modes">
                <div class="game-modes-column">
                    <p>
                        <strong>Game modes:</strong>
                    </p>
                    <div>
                        <label title="Everyone against everyone."><input type="radio" name="mode" value="death-match"
                                                                         checked autofocus> Death match</label>
                    </div>
                    <div>
                        <label title="Fight between teams."><input type="radio" name="mode" value="teams"> Teams</label>
                    </div>
                    <div>
                        <label title="One on one duel."><input type="radio" name="mode" value="duel"> Duel</label>
                    </div>
                    <div>
                        <label title="Survive with a waives of enemies."><input type="radio" name="mode"
                                                                                value="survival"> Survival</label>
                    </div>
                </div>
                <div class="game-modes-column">
                    <p>
                        <strong>Fun modes:</strong>
                    </p>
                    <div>
                        <label title="Two big teams against each other."><input type="radio" name="mode" value="swarm">
                            Swarm</label>
                    </div>
                    <div>
                        <label title="Total domination."><input type="radio" name="mode" value="domination"> Overpowered</label>
                    </div>
                    <div>
                        <label title="Revenge of cows."><input type="radio" name="mode" value="revenge"> Revenge</label>
                    </div>
                </div>
            </div>
            <div class="action">
                <button class="btn"> Start</button>
            </div>
        </form>

        <div class="stats"></div>
        <canvas class="demo"></canvas>
    </section>
</main>

<div class="ui">
    <div class="cockpit">
        <div class="missile-capacity">
            <div class="missile"></div>
            <div class="missile"></div>
        </div>
        <div class="thrust">
            <div class="thrust-level"></div>
        </div>
        <div class="ammo-capacity">
            <div class="ammo"></div>
            <div class="ammo"></div>
            <div class="ammo"></div>
            <div class="ammo"></div>
            <div class="ammo"></div>
            <div class="ammo"></div>
            <div class="ammo"></div>
            <div class="ammo"></div>
            <div class="ammo"></div>
            <div class="ammo"></div>
            <div class="ammo"></div>
            <div class="ammo"></div>
            <div class="ammo"></div>
            <div class="ammo"></div>
            <div class="ammo"></div>
        </div>
    </div>
    <canvas class="minimap"></canvas>
    <div class="log"></div>
</div>
